import { Container } from 'react-bootstrap';

function App() {
  return (
    <>
    <Navbar />
    <Router>
      <Switch>
        <Route path="/" exact component={Homepage} />
      </Switch>
    </Router>
    <Container className="d-flex justify-content-center align-items-center" style={{ minHeight: "100vh"}}>
      <div className=""></div>
    <SignUp />
    </Container>
    </>
  );
}

export default App;
